webpackJsonp([0xbc4ad56c686],{374:function(i,e){i.exports={data:{markdownRemark:{html:'<h3>Описание:</h3>\n<p>Жим гантели из-за головы сидя считается одним из самых популярных упражнений на трицепс. В большей степени оно подходит для новичков, так как из-за своих особенностей более удобно, чем жим стоя. </p>\n<h3>Порядок выполнения:</h3>\n<ol>\n  <li>Для выполнения этого упражнения Вам понадобится горизонтальная скамья со спинкой. Сядьте на скамью и возьмите гантель обеими руками за основание.</li>\n  <li>Исходное положение: удерживайте гантель на вытянутых руках так, чтобы часть руки от плеча до локтя была перпендикуляра полу и находилась около Вашей головы.</li>\n  <li>На вдохе – плавно опускайте гантель за голову до тех пор, пока Ваши предплечья не коснутся бицепсов.</li>\n  <li>На выдохе – напрягая трицепсы, сделайте подъем гантелей, вернувшись в исходное положение.</li>\n  <li>Сделайте требуемое количество повторений.</li>\n</ol>\n<h3>Советы:</h3>\n<ul>\n  <li>Для новичков возможен вариант исполнения этого упражнения с диском от штанги вместо гантели.</li>\n  <li>На протяжении всего упражнения не давайте локтям гулять в разные стороны, так как это сильно снижает эффективность упражнения.\n</li>\n  <li>Подбирайте отягощение так, чтобы Вы могли сделать не менее 8 повторений.</li>\n</ul>\n<h3>Видео-инструкция:</h3>\n<iframe width="100%" height="550rem" src="https://www.youtube.com/embed/hLOl4nJlo0I" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>',frontmatter:{path:"/exercise/francuzskii-jim-s-ganteleami-sidya",efficiency:"7",title:"Французский жим с гантелями сидя",image:"/4-05-0.png",image_2:"/4-05-1.png",image_3:"",image_4:"",filterby:"triceps",date:"April 12, 2017",injury:"5",bodypart:"Трицепс",filtertype:"isolated",type:"Изолирующее",filterinventory:"dumbbells",inventory:"Гантели",filterplace:null}}},pathContext:{}}}});
